import React from "react";
import "../Stylesheets/Projects.css";
import { projects } from "../constants";
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineDot,
  TimelineOppositeContent,
} from "@mui/lab";
import { Button } from "@mui/material";
import Header from "./Header";

export default function Projects({ projectsRef }) {
  return (
    <div className="flex justify-center items-center h-screen">
      <div className="projects flex flex-col gap-4" ref={projectsRef}>
        <Header headerName="Featured Projects" />
        <div className="timeline w-[55%]">
          <Timeline position="left">
            {projects.map((project, index) => {
              return (
                <TimelineItem key={index}>
                  <TimelineOppositeContent>
                    <div className="project-container flex flex-col mx-auto max-w-[450px] rounded-[14px] p-6 justify-center bg-white gap-3">
                      <img
                        className="rounded-lg"
                        src={project.img}
                        alt={project.alt}
                      />
                      <span className="project-title font-bold text-md">
                        {project.name}
                      </span>
                      <span className="project-description text-sm">
                        {project.description}
                      </span>
                      <p className="project-tech text-xs flex flex-row content-between">
                        {project.stack}
                      </p>
                      <Button className="project-link">View More</Button>
                    </div>
                  </TimelineOppositeContent>
                  <TimelineSeparator>
                    <TimelineDot />
                    <TimelineConnector />
                  </TimelineSeparator>
                  <div className="content">
                  <TimelineContent><span>{project.date}</span></TimelineContent>
                  </div>
                </TimelineItem>
              );
            })}
          </Timeline>
        </div>
      </div>
    </div>
  );
}
